export interface IItemElement extends IElementBase{
 	/**道具ID*/
	ID:number
	/**英文名称*/
	Name:string
	/**英文描述*/
	description:string
	/**是否为主游戏道具*/
	isMain:boolean
	/**排序优先级*/
	Sort:number
	/**等级*/
	Level:number
	/**下一等级ID*/
	NextID:number
	/**最大经验值*/
	MaxExp:number
	/**技能(skill_技能描述表)*/
	Skills:Array<number>
	/**耐久度*/
	Durability:number
	/**耐久度消耗*/
	Reduce:number
	/**最大道具数量*/
	MaxCount:number
	/**图标(GUID)*/
	Icon:string
	/**是否有图标*/
	haveicon:number
	/**装备表ID
（PropAction表）*/
	Resource:number
	/**动作表ID*/
	Action:number
	/**标签页：1、普通类2、魔法类3、圣物4、门票类*/
	TagType:number
	/**道具类别：1、魔杖类  2、工具类  3、消耗品  4、材料类  5、狸月商店  6、杂物 7、契约之戒  99、货币*/
	ItemType:number
	/**初始值*/
	DefaultCount:number
	/**战斗类别：1、None 2、PVP 3、PVE*/
	FightingType:Array<number>
	/**是否能在商店购买*/
	isPurchase:boolean
	/**是否能在商店出售*/
	isSale:boolean
	/**商店类别：1、正常商店 2、夜晚商店*/
	ShopType:number
	/**货币类别：1、金币   2、金月   3、银月*/
	MoneyType:number
	/**价格*/
	Price:number
	/**添加道具时是否在快捷栏显示*/
	isShowInBar:boolean
	/**是否可给予*/
	isCanGive:boolean
 } 
